CREATE TABLE public.search_facilityfacilitytype
(
    id              integer PRIMARY KEY NOT NULL,
    facility_id     integer             NOT NULL,
    facility_type_id integer             NOT NULL
);

CREATE SEQUENCE public.search_facilityfacilitytype_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE public.search_facilityfacilitytype_id_seq OWNED BY public.search_facilityfacilitytype.id;

ALTER TABLE ONLY public.search_facilityfacilitytype
    ALTER COLUMN id SET DEFAULT nextval('public.search_facilityfacilitytype_id_seq'::regclass);

ALTER TABLE ONLY public.search_facilityfacilitytype
    ADD CONSTRAINT fk_search_service_id FOREIGN KEY (facility_id) REFERENCES public.search_facility (id);

ALTER TABLE ONLY public.search_facilityfacilitytype
    ADD CONSTRAINT fk_search_servicearea_id FOREIGN KEY (facility_type_id) REFERENCES public.admin_facilitytype (id);

